import React from "react";
import Header from "../Header/Header";
import kids from "../Images/kids.png"
import dogs from "../Images/dogs.png"
import cleaning from "../Images/cleaning.png"

export default function HomePage() {
  return (
    <div>
      <Header/>
      <div className="bg-[#f2f3f7] flex justify-around pt-10 pb-0">
        <div>
          <img src={kids} alt="kids" className="w-[226px] h-[150px] rounded-xl mb-12"/>
          <img src={cleaning} alt="cleaning" className="w-[170px] h-[225px] rounded-xl ml-32"/>
        </div>
        <div>
        <img src={dogs} alt="dogs" className="w-[638px] h-[524px] rounded-xl rounded-bl-none rounded-br-none"/>
        </div>
      </div>
    </div>
  );
}
